import './App.css';
import React from 'react';
import { Container, Row, Col, Table, Navbar } from 'reactstrap';
import Data_table from './components/Table';
import Nav_bar from './components/Nav_bar';
import Table_View from './components/Table_View';
import Firmware_Version from './components/Firmware_Version';
import Output from './components/Output';

import Test from './components/Test';
// import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      datavalue: 1
    }
    this.number = 2
  }
  // examHandle() {
  //   console.log(this.number, this.state)
  //   this.setState({
  //     datavalue: this.state.datavalue + 1
  //   })
  // }
  render() {
    // console.log('hello world')
    return (
      <div>
        {
          <div>
            <Nav_bar></Nav_bar>

            <div class="container-fluid">
              <div class="row">
                <div class="col">
                  <div>
                    <Table_View></Table_View>
                  </div>
                </div>
                <div class="col">
                  <Firmware_Version></Firmware_Version>
                </div>
                <div class="col">
                  <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                    <a href="http://localhost:3000/" type="button" class="btn btn-danger">
                      Refresh Page
                    </a>
                  </div>
                </div>
              </div>

              <div class="row">
                <div class="col">
                  <div>
                    <nav aria-label="breadcrumb">
                      <ol class="breadcrumb">
                        <li class="breadcrumb-item active" aria-current="page"></li>
                      </ol>
                    </nav>
                  </div>
                </div>
                <div class="col">
                  {/* Column2 Row2 */}
                </div>
              </div>
              <div class="row">
                <div class="col-7">
                  <Data_table></Data_table>
                </div>
                <div class="col-5">
                  <Output></Output>
                </div>
              </div>
              <div class="row">
                <div class="col">

                </div>
                <div class="col">

                </div>
                <div class="col">
                  <div class="expt d-grid justify-content-md-end">
                    <button type="button" class="btn btn-success">
                      Export Report File
                    </button>
                  </div>
                  <div class="expt d-grid justify-content-md-end">
                    <button type="button" class="btn btn-warning">
                      Export Current Data
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        }
      </div>
    );
  }

}
export default App;
